  return (
    <div className="socialnetwork">
      <p>Join us with </p>
      <FaFacebook color="purple" size="5rem" className="icon" />
      <FaInstagram color="purple" size="5rem" className="icon" />
    </div>
  );
};

export default SocialNetwork;
